"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Blood in the urine (hematuria) in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/blood-in-the-urine-hematuria-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H7833494\">",
"      <span class=\"h1\">",
"       Should I be worried if there is blood in my child&rsquo;s urine?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It can be scary to see blood in your child&rsquo;s urine. But try to stay calm. Blood in the urine is not usually serious. Still, it is important for your child to see a doctor or nurse. The medical term for blood in the urine is &ldquo;hematuria.&rdquo;",
"     </p>",
"     <p>",
"      Blood in the urine can come from the kidneys (where urine is made) or anywhere in the urinary tract. The urinary tract includes all the organs that deal with urine (",
"      <a class=\"graphic graphic_figure graphicRef65630 \" href=\"UTD.htm?14/27/14769\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7833509\">",
"      <span class=\"h1\">",
"       What causes blood in the urine?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Blood in the urine can be caused by lots of problems. In children, these include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bladder infection, which can cause burning or pain when urinating",
"       </li>",
"       <li>",
"        Kidney infection, which can cause back pain and fever",
"       </li>",
"       <li>",
"        Kidney stones, which usually cause belly or back pain",
"       </li>",
"       <li>",
"        Irritation of the urethra (the tube that connects the bladder to the outside of the body)",
"       </li>",
"       <li>",
"        Certain kidney diseases",
"       </li>",
"       <li>",
"        Intense exercise",
"       </li>",
"       <li>",
"        Injury (for example, if your child falls off a bike and bruises a kidney)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Sometimes, urine can look as though it is bloody even though it isn&rsquo;t. This can happen if your child eats a lot of beets or food dyes, or takes certain medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7833524\">",
"      <span class=\"h1\">",
"       Should my child see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See a doctor or nurse if you see blood in your child&rsquo;s urine, or if your child&rsquo;s urine is pink, red, brownish-red, or the color of tea.",
"     </p>",
"     <p>",
"      Sometimes, doctors find blood in the urine when they do a routine urine test. That can happen even if the urine looks normal. It means there are microscopic (trace) amounts of blood in the urine.",
"     </p>",
"     <p>",
"      Sometimes, your child might need to see a doctor who specializes in treating kidney problems in children.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7833539\">",
"      <span class=\"h1\">",
"       Which tests should my child have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests to do based on your child&rsquo;s symptoms and individual situation. There are lots of tests, but your child might not need all of them.",
"     </p>",
"     <p>",
"      Here are the most common tests doctors use to find the cause of blood in the urine in children:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Urine tests",
"        </strong>",
"        &ndash; Urine tests can show what kind of cells are in the urine. This can hold clues about what might be going wrong. The doctor might also measure the amount of protein in your child&rsquo;s urine, since too much protein can be a sign of a kidney problem.",
"        <br/>",
"        <br/>",
"        If your child has trace amounts of blood in the urine and it doesn&rsquo;t go away over time, he or she might have something called &ldquo;familial hematuria.&rdquo; This condition often affects family members, so your child&rsquo;s doctor might suggest that other people in your family get urine tests, too. Familial hematuria does not usually cause any other symptoms or health problems.",
"       </li>",
"       <li>",
"        <strong>",
"         Blood tests",
"        </strong>",
"        &ndash; Blood tests can show whether the kidneys are working normally, or if the child has other health problems.",
"       </li>",
"       <li>",
"        <strong>",
"         CT scan",
"        </strong>",
"        &ndash; A CT scan is a special kind of X-ray. It creates a picture of the kidneys and urinary tract. Doctors can use it to check for kidney stones and other problems in the urinary tract.",
"       </li>",
"       <li>",
"        <strong>",
"         Kidney ultrasound",
"        </strong>",
"        &ndash; A kidney ultrasound is another way to create a picture of the kidneys. Doctors sometimes use ultrasound instead of a CT scan.",
"        <br/>",
"        <br/>",
"        If your child has blood the urine after an injury, his or her doctor will probably do a CT scan or ultrasound to check the urinary tract for problems.",
"       </li>",
"       <li>",
"        <strong>",
"         Blood pressure",
"        </strong>",
"        &ndash; Your child&rsquo;s blood pressure will probably be measured. That&rsquo;s because high blood pressure can be a sign of certain kidney problems.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7833554\">",
"      <span class=\"h1\">",
"       Should my child be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what seems to have caused the blood in your child&rsquo;s urine. If your child had blood in his or her urine because of a bruise to the kidney, he or she might not need any treatment. On the other hand, if your child has blood in his or her urine because of a bladder or kidney infection, he or she will probably need antibiotics.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7833569\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?10/38/10850?source=see_link\">",
"       Patient information: Urinary tract infections in children (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?26/38/27234?source=see_link\">",
"       Patient information: Kidney stones in children (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?22/59/23474?source=see_link\">",
"       Patient information: Blood in the urine (hematuria) in adults (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?1/9/1169?source=see_link\">",
"       Patient information: Blood in the urine (hematuria) in children (Beyond the Basics)",
"      </a>",
"     </p>",
