var title_f16_51_17211="SPN malignancy prediction";
var content_f16_51_17211=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F79139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F79139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Probability of malignancy of a solitary pulmonary nodule",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1) Probability of malignancy = e",
"        <sup>",
"         x",
"        </sup>",
"        /(1+e",
"        <sup>",
"         x",
"        </sup>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        2) x = -6.8272 + (0.0391 X age) +",
"(0.7917 X \"cigarettes\") + (1.3388 X \"cancer\") + (0.1274 X \"diameter\") +",
"(1.047 X \"spiculation\") + (0.7838 X \"upper lobe\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3) \"age\" = patient's age in years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        \"cigarettes\" = 1 if patient is a current or former",
"smoker, otherwise 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        \"cancer\" = 1 if patient has a",
"history of an extrathoracic cancer that was diagnosed &gt;5 years",
"before presentation, otherwise 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        \"diameter\" = diameter of the solitary pulmonary nodule",
"in mm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        \"spiculation\" = 1 if spiculation is",
"present, otherwise 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        \"upper lobe\" = 1 if the nodule is located in the upper",
"lobe, otherwise 0",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Swensen, SJ, Silverstein, MD, Ilstrup, DM, et al, Arch Intern Med 1997; 157:849.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
