var title_f16_51_17212="Short-term prophylaxis for HAE";
var content_f16_51_17212=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F83117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F83117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Short-term prophylaxis to prevent angioedema in C1 inhibitor deficiency",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Minor manipulations:",
"       </td>",
"       <td class=\"subtitle1\">",
"        Major procedures:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Routine dental cleanings (unless patient has tolerated same procedure in past without prophylaxis)",
"       </td>",
"       <td>",
"        Intubation, oral surgery (cutting of tissues), dental procedures involving injections of anesthetics, general surgery, other procedures that precipitated past attacks in that patient",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Option 1:",
"        </strong>",
"        (On demand) No additional treatment in advance, but have treatment for acute angioedema immediately available&nbsp;if symptoms develop:",
"        <ul>",
"         <li>",
"          C1 inhibitor replacement product",
"         </li>",
"         <li>",
"          Ecallantide",
"         </li>",
"         <li>",
"          Icatibant",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Note:",
"         </strong>",
"         Ecallantide and icatibant have",
"         <strong>",
"          not",
"         </strong>",
"         been studied for use in advance of a procedure, although they can be given if angioedema develops",
"        </p>",
"       </td>",
"       <td>",
"        <strong>",
"         Option 1:",
"        </strong>",
"        Give C1 inhibitor replacement product one hour before procedure, with two additional doses available on demand",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <p>",
"         <strong>",
"          Option 2:",
"         </strong>",
"         Premedicate with androgens for&nbsp;five days before and&nbsp;five days after procedure",
"        </p>",
"        <p>",
"         Examples:",
"        </p>",
"        <ul>",
"         <li>",
"          Danazol, 10 mg/kg per day up to 600 mg daily or equivalent doses of another attenuated androgen",
"         </li>",
"         <li>",
"          For patients on long-term androgens, increase dose by 50 to 100 percent for&nbsp;five days before and&nbsp;five days after",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Option 2:",
"         </strong>",
"         If option 1 is not possible, then give premedication with androgens (as described above) for&nbsp;five days before and&nbsp;five days after",
"        </p>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          PLUS:",
"         </strong>",
"         Consider giving 2 units solvent-detergent treated plasma or fresh frozen plasma one hour before procedure",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Option 3:",
"        </strong>",
"        Combine on demand therapy with androgen premedication",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
