var title_f16_51_17214="Diagnosis and reporting grid for NSF scoring system";
var content_f16_51_17214=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F55350&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F55350&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 539px\">",
"   <div class=\"ttl\">",
"    Diagnosis and reporting grid for nephrogenic systemic fibrosis (NSF) scoring system",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 519px; height: 248px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Using grid:",
"    <br>",
"     Clinical score is located across top row of grid, whereas histologic score is located along left vertical column. Intersection of these two values within chart results in one of&nbsp;six diagnostic possibilities. For epidemiologic purposes, those in green should be scored as confirmed nephrogenic systemic fibrosis (NSF) cases. Those in yellow should be closely re-examined and perhaps rebiopsied. Until more compelling evidence is obtained, these will not have satisfied criteria for NSF and should be considered nondiagnostic of NSF. Those in red are ruled out either for lack of criteria or because another Dx can be made.",
"     <br>",
"      <br>",
"       Caveats:",
"       <br>",
"        <ol>",
"         <li>",
"          Absence of documentable renal disease: in the unlikely event the final patient score falls into NSF box, yet current or prior renal disease cannot be established, the most certain Dx that should be rendered is \"suggestive of NSF.\" Consultants with extensive NSF experience should evaluate any such case, as it would represent a highly unusual occurence.",
"         </li>",
"         <li>",
"          Postmortem evaluation of suspected NSF: the histological assessment of NSF in the postmortem setting is not difficult, provided the diagnosis is suspected clinically and generous samples of contiguous skin, fascia, and underlying muscle are obtained. This type of specimen is not gathered during a routine postmortem examination, however, so the pathologist must be made aware of the suspected diagnosis in advance to assure appropriate sampling. The clinical examination is much more challenging as neither induration nor range of motion can be appropriately assessed, and livedoid patterning may occur as a normal postmortem finding. Scleral plaques in persons younger than 45 years of age, if combined with excellent histology and a good physician-documented corroborative medical record, may enable a definitive diagnosis in the postmortem setting.",
"         </li>",
"        </ol>",
"        <div class=\"footnotes\">",
"        </div>",
"        <div class=\"reference\">",
"         Reproduced from: Girardi M, Kay J, Elston DM, et al. Nephrogenic systemic fibrosis: clinicopathological definition and workup recommendations. J Am Acad Dermatol 2011; 65:1095. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"        </div>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
